import React from 'react';

const Layout = ({ children }) => {
  return (
    <div className="">
      {children}
    </div>
  );
};

const Nav = ({ children }) => {
  return (
    <div className="py-4 px-6 text-sm font-medium">
      <ul className="flex space-x-3">
        {children}
      </ul>
    </div>
  );
};
export { Layout, Nav};
